import React from 'react';

const Sidebar = () => {
  return (
    <div className="bg-dark text-white p-4" style={{ width: '250px', height: '100vh' }}>
      <h5 className="fw-bold">User Info</h5>
      <p>Username: Sakshi</p>
      <nav>
        <ul>
          <li><a href="#" className="text-white">Dashboard</a></li>
          <li><a href="#" className="text-white">Profile</a></li>
          <li><a href="#" className="text-white">Logout</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default Sidebar;
